import React, {Component} from 'react';
import axios from 'axios';


const api = axios.create({
    baseURL : `http://localhost:3000/covid/`
})

class App extends Component {

    constructor() {
        super();
        api.get('/').then(res => {
            console.log(res.data)
        })
    }

   

}

export default Today;
